import './CreateEventLayout.css'
import {Button} from 'react-bootstrap'
const CreateEventLayout = () => {
    return(
        <div className="selectForm1">
            <h5 className="text-center">Create Event</h5>
            <button class="circle plus"></button>

        </div>
    )
}


export default CreateEventLayout;
